import sys
from vllm import LLM, SamplingParams
from vllm.engine.arg_utils import EngineArgs
from vllm.inputs import PromptType
from vllm.utils import FlexibleArgumentParser
import os

# Seed setup for reproducibility
seed = 42
random.seed(seed)
np.random.seed(seed)
torch.manual_seed(seed)
if torch.cuda.is_available():
    torch.cuda.manual_seed_all(seed)

# Sampling parameters
sampling_params = SamplingParams(
    n=1,
    temperature=1.0,
    top_p=0.8,
    seed=seed,
    max_tokens=100,
)
print(sampling_params)

# Environment settings
os.environ["VLLM_TORCH_PROFILER_DIR"] = "/vllm-workspace/tokenweave"
os.environ["VLLM_USE_V1"] = "1"

# -------------------------
# Argument parser for model
# -------------------------
parser = argparse.ArgumentParser(description="Run inference with a selected model.")
parser.add_argument(
    "--model",
    choices=["mixtral", "qwen2", "llama3"],
    required=True,
    help="Select the model to use: mixtral, qwen2, or llama3",
)
args = parser.parse_args()

# Load model based on user choice
if args.model == "mixtral":
    llm = LLM(
        model="mistralai/Mixtral-8x22B-Instruct-v0.1",
        tokenizer_mode="mistral",
        tensor_parallel_size=8,
        enforce_eager=True,
        disable_custom_all_reduce=True,
        enable_chunked_prefill=True,
        max_num_batched_tokens=2048,
        enable_prefix_caching=False,
    )
elif args.model == "qwen2":
    llm = LLM(
        model="Qwen/Qwen2.5-72B-Instruct",
        tensor_parallel_size=8,
        enforce_eager=True,
        disable_custom_all_reduce=True,
        enable_chunked_prefill=True,
        max_num_batched_tokens=2048,
        enable_prefix_caching=False,
    )
else:  # llama3
    llm = LLM(
        model="meta-llama/Llama-3.3-70B-Instruct",
        tensor_parallel_size=8,
        enforce_eager=True,
        disable_custom_all_reduce=True,
        enable_chunked_prefill=True,
        max_num_batched_tokens=2048,
        enable_prefix_caching=False,
    )

